import React,{useEffect, useState} from 'react';
import Axios from 'axios';
import './App.css';
import { Link } from 'react-router-dom';

const Header = () => {
  	return (
  		<div>
  				<p>Header</p>
  		</div>
  	)
  };

  const Homepage = () => {
  	return (
  		<div>

  				<h1>Homepage </h1>
  				<Link to='/about'>Go to Aboutpage</Link>
  		</div>
  	)
  };

  const Aboutpage = () => {
  	return (
  		<div>
  				<Header/>
  				<h1>Aboutpage</h1>
  				<Link to='/'>Go to Aboutpage</Link>
  		</div>
  	)
  };
  export {Homepage, Aboutpage } ;


function App() {
  return (
    <div className="App">
      <h1 id="Titel">Pharamkologie</h1> 
      <div className = "menubar">
      <a id ="agroup" href="http://localhost:3000" >search</a>
      <a id ="agroup" href="http://localhost:3000" >Wirkstoffe</a>
      <a id ="agroup" href="http://localhost:3000" >Hilfstoffe</a>
      <a id ="agroup" href="http://localhost:3000" >Kompatebilität Prüfen</a>
      </div>


    </div>
  );
}

export default App;
